import React, {useCallback, useEffect, useState} from 'react';
import {login} from '../store/actions/login';
import {Link, useNavigate} from 'react-router-dom';
import {useDispatch, useSelector} from 'react-redux';
import HomeIcon from "@mui/icons-material/Home";


export default function Account() {

    const [logValue, setLogValue] = useState('');
    const [pasValue, setPasValue] = useState('');
    const dispatch = useDispatch();
    const signIn = useSelector((state) => state.login.users);
    const navigate = useNavigate()

    useEffect(() => {
        (async () => {
            if (signIn.length) {
                await dispatch(login());
            }
        })();
    }, []);

    const handleSubmit = useCallback(async (ev) => {
        ev.preventDefault()
        const data = await dispatch(login({
            email: logValue,
            password: pasValue,
        }))
        if(data.payload){

        }
    }, [logValue, pasValue])

    return (
        <>
            <div className='signInPage'>
                <div className="box">
                    <span className="borderLine"></span>
                    <a href='/' className="home">
                        <HomeIcon style={{fontSize: 20, verticalAlign: 'sub'}}/>
                        Home
                    </a>
                    <form onSubmit={(ev) => handleSubmit(ev)}>
                        <h2>Sign in</h2>
                        <div className="inputBox">
                            <input value={logValue} onChange={(ev) => setLogValue(ev.target.value)} type="email"
                                   required="required"/>
                            <span>Login</span>
                            <i/>
                        </div>
                        <div className="inputBox password">
                            <input value={pasValue} onChange={(ev) => setPasValue(ev.target.value)} type="password"
                                   required="required"/>
                            <span>Password</span>
                            <i/>
                        </div>
                        <div className="links">
                            <Link to="/register">Sign up</Link>
                        </div>
                        <input type="submit" value="Login"/>
                    </form>
                </div>
            </div>
        </>
    )
}
